-- public.products определение

-- Drop table

-- DROP TABLE public.products;

CREATE TABLE public.products (
	product_id varchar(10) NOT NULL,
	title varchar(100) NOT NULL,
	"cost" numeric NOT NULL,
	max_discount_amount int4 NULL,
	discount_amount int4 NULL,
	quantity_in_stock int4 NOT NULL,
	description text NULL,
	unit_type_id int4 NOT NULL,
	manufacturer_id int4 NOT NULL,
	supplier_id int4 NOT NULL,
	category_id int4 NOT NULL,
	photo bytea NULL,
	CONSTRAINT product_pk PRIMARY KEY (product_id),
	CONSTRAINT product_category_fk FOREIGN KEY (category_id) REFERENCES public.categories(category_id) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT product_manufacturer_fk FOREIGN KEY (manufacturer_id) REFERENCES public.manufacturers(manufacturer_id) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT product_supplier_fk FOREIGN KEY (supplier_id) REFERENCES public.suppliers(supplier_id) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT product_unittype_fk FOREIGN KEY (unit_type_id) REFERENCES public.unit_types(unit_type_id) ON DELETE CASCADE ON UPDATE CASCADE
);


-- public.users определение

-- Drop table

-- DROP TABLE public.users;

CREATE TABLE public.users (
	first_name varchar(30) NOT NULL,
	second_name varchar(30) NOT NULL,
	middle_name varchar(30) NULL,
	user_name varchar(50) NOT NULL,
	"password" varchar(50) NOT NULL,
	role_id int4 NULL,
	CONSTRAINT user_pk PRIMARY KEY (user_name),
	CONSTRAINT user_role_fk FOREIGN KEY (role_id) REFERENCES public.roles(role_id) ON DELETE CASCADE ON UPDATE CASCADE
);


-- public.orders определение

-- Drop table

-- DROP TABLE public.orders;

CREATE TABLE public.orders (
	order_id int4 DEFAULT nextval('order_id_seq'::regclass) NOT NULL,
	status_id int4 NOT NULL,
	pickuppoint_id int4 NOT NULL,
	create_date date NOT NULL,
	delivery_date date NOT NULL,
	user_name varchar(50) DEFAULT NULL::character varying NULL,
	get_code int4 NOT NULL,
	CONSTRAINT order_pk PRIMARY KEY (order_id),
	CONSTRAINT order_pickup_point_fk FOREIGN KEY (pickuppoint_id) REFERENCES public.pickup_points(pickup_point_id),
	CONSTRAINT order_status_fk FOREIGN KEY (status_id) REFERENCES public.statuses(status_id),
	CONSTRAINT order_user_fk FOREIGN KEY (user_name) REFERENCES public.users(user_name) ON DELETE SET NULL ON UPDATE SET NULL
);


-- public.order_products определение

-- Drop table

-- DROP TABLE public.order_products;

CREATE TABLE public.order_products (
	product_id varchar(10) NOT NULL,
	order_id int4 NOT NULL,
	count int4 NULL,
	CONSTRAINT order_product_pk PRIMARY KEY (product_id, order_id),
	CONSTRAINT order_product_order_fk FOREIGN KEY (order_id) REFERENCES public.orders(order_id),
	CONSTRAINT order_product_product_fk FOREIGN KEY (product_id) REFERENCES public.products(product_id)
);

